206,5,1,#:Event_If_EventState 201 6 0:#:Event_EventState 201 5 0:,路人對話重啟,
906,5,1,#:Event_If_EventState 999 6 0:#:Event_RebornDialog 52 37580 31 24:Event_TriggerEvent 907 3 0:Event_TriggerEvent 925 20 0:Event_EventState 906 6 0:,對不起… 對不起… 知道錯了。,
907,5,1,#:Event_If_EventState 999 6 0:#:Event_RebornDialog 53 37581 31 24:Event_TriggerEvent 908 3 0:,饒了我們吧，我們只是一時鬼迷心竅。,
908,5,1,#:Event_If_EventState 999 6 0:#:Event_RebornDialog 54 37582 31 24:Event_TriggerEvent 909 2 0:,你們這些可惡的人類，還敢來打擾我們。,
909,5,1,#:Event_If_EventState 999 6 0:#:Event_RebornDialog 55 37583 31 24:Event_RebornDialog 56 37583 31 24:Event_TriggerEvent 910 2 0:,可惡的人類∼！,
910,5,1,#:Event_If_EventState 999 6 0:#:Event_RebornDialog 54 37584 31 24:Event_TriggerEvent 911 2 0:,我要一隻不剩地把人類驅逐出去！,
911,5,1,#:Event_If_EventState 999 6 0:#:Event_RebornDialog 55 37585 31 24:Event_RebornDialog 56 37585 31 24:Event_TriggerEvent 912 2 0:,驅逐出去∼！,
912,5,1,#:Event_If_EventState 999 6 0:#:Event_RebornDialog 54 37586 31 24:Event_TriggerEvent 913 2 0:,獻出你們的睡眠！,
913,5,1,#:Event_If_EventState 999 6 0:#:Event_RebornDialog 55 37587 31 24:Event_RebornDialog 56 37587 31 24:Event_ScreenMessage 37589 0 0:,為了眠羊∼,
914,5,1,#:Event_If_EventState 999 6 0:#:Event_ScreenMessage 37578 0 0:,這天起眠羊們又回想起人類的恐怖。,
915,5,1,#:Event_If_EventState 999 6 0:#:Event_RebornDialog 57 37590 31 24:Event_TriggerEvent 916 2 0:Event_TriggerEvent 924 20 0:Event_EventState 915 6 0:,睡一覺，羊就開始跳躍。,
916,5,1,#:Event_If_EventState 999 6 0:#:Event_RebornDialog 57 37591 31 24:Event_TriggerEvent 917 3 0:,每一晚，每一夜。,
917,5,1,#:Event_If_EventState 999 6 0:#:Event_RebornDialog 57 37592 31 24:Event_TriggerEvent 918 2 0:,羊在跳，跳到人們睡著。,
918,5,1,#:Event_If_EventState 999 6 0:#:Event_RebornDialog 37593 57 31 24:Event_TriggerEvent 919 2 0:,叫人類，不要數。,
919,5,1,#:Event_If_EventState 999 6 0:#:Event_RebornDialog 57 37594 31 24:Event_TriggerEvent 920 2 0:,我相信我已經快要。,
920,5,1,#:Event_If_EventState 999 6 0:#:Event_RebornDialog 57 37595 31 24:Event_TriggerEvent 921 2 0:,快要進入深眠。,
